import React from 'react';
import EmailList from './EmailList';
import StatGraph from './StatGraph';

const App: React.FC = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold">Email Delivery Checker</h1>
      <StatGraph />
      <EmailList />
    </div>
  );
};

export default App;
